import React, { Component } from "react";

export default class Message extends Component {
  state = {
    messageArr: [{ id: "01", title: "消息1" }],
  };
  render() {
    const { messageArr } = this.state;
    return (
      <div>
        {messageArr.map((msgObj) => {
          return (
            <li key={msgObj.id}>
              <a href="/xxx">{msgObj.title}</a> &nbsp; &nbsp;
            </li>
          );
        })}
      </div>
    );
  }
}
